const FakeUUID=(t={})=>{let{startsWith:l="",endsWith:e="",length:n=32,digit:o=!0,lowerAlphabets:r=!0,upperAlphabets:s=!1,specialChars:i=""}=t,p=[...o?"0123456789".split(""):[],...s?"ABCDEFGHIJKLMNOPQRSTUVWXYZ".split(""):[],...r?"abcdefghijklmnopqrstuvwxyz".split(""):[],...i.split(""),].sort(()=>Math.random()-.5),a=l;for(;a.length<n+l.length;){let g=Math.floor(Math.random()*p.length);a+=p[g]}return a+e};